SU HOGAR SE ENCUENTRA EN LÍNEA DE INTERVENCIÓN NO DEFINIDA, NO CUMPLE CON ALGUNO DE LOS REQUISITOS PARA PERTENECER A VALORACIÓN DEL CUIDADO. NO ES SUSCEPTIBLE DE TMC. INFORMA QUE ELLA ESTÁ SOLA CON SU NNA, POR LO QUE SE PREGUNTA &quot;¿YA ACTUALIZÓ ESA INFORMACIÓN EN SU ENCUESTA DE SISBÉN IV? Y ABANDONA SALA
&quot;
FALLA DE PC REPORTADA EN BITACORA.

&quot;SERÁN BENEFICIARIAS DE LA RENTA BÁSICA SOLIDARIA LAS PERSONAS QUE CUMPLAN CON LOS SIGUIENTES REQUISITOS:

A) SER CIUDADANO(A) COLOMBIANO(A);
B) TENER MÍNIMO SESENTA Y CINCO (65) AÑOS LOS HOMBRES Y SESENTA (60) AÑOS LAS MUJERES, O SER HOMBRE MAYOR DE (55) AÑOS CON DISCAPACIDAD O MUJER MAYOR DE (50) AÑOS Y POSEER UNA PÉRDIDA DE CAPACIDAD LABORAL IGUALO SUPERIOR AL 50%.
C) INTEGRAR EL GRUPO DE POBREZA EXTREMA, POBREZA Y VULNERABILIDAD;
D) ACREDITAR RESIDENCIA EN EL TERRITORIO COLOMBIANO MÍNIMO DE DIEZ (10) AÑOS INMEDIATAMENTE ANTERIORES A LA FECHA DE PRESENTACIÓN DE LA SOLICITUD PARA ACCEDER A LA RENTA BÁSICA SOLIDARIA.
E) NO TENER PENSIÓN.&quot;

&quot;LE INFORMO QUE PROSPERIDAD SOCIAL NO MANEJA ESTA INFORMACIÓN. LA ENTIDAD QUE PUEDE AYUDARLE EN ESTE CASO ES COLPENSIONES, YA QUE ES LA ENCARGADA DE GESTIONAR ESE TIPO DE SOLICITUDES.
DEBE COMUNICARSE DIRECTAMENTE CON ELLOS PARA OBTENER UNA RESPUESTA PRECISA Y OPORTUNA. CON GUSTO LE BRINDARÉ LOS CANALES DE ATENCIÓN: LÍNEA NACIONAL 018000410777 (SOLO DESDE TELÉFONO FIJO), EN BOGOTÁ (601) 4870300, EN EL HORARIO DE LUNES A VIERNES DE 6 AM A 8 PM Y SÁBADOS DE 8 AM A 1 PM.&quot;

----------------

&quot;LE INFORMO QUE PROSPERIDAD SOCIAL NO MANEJA ESTA INFORMACIÓN. LA ENTIDAD QUE PUEDE AYUDARLE EN ESTE CASO ES EL FONDO DE SOLIDARIDAD PENSIONAL, YA QUE ES LA ENCARGADA DE GESTIONAR ESE TIPO DE SOLICITUDES.
DEBE COMUNICARSE DIRECTAMENTE CON ELLOS PARA OBTENER UNA RESPUESTA PRECISA Y OPORTUNA. CON GUSTO LE BRINDARÉ LOS CANALES DE ATENCIÓN:  LÍNEA NACIONAL 018000184333 (SOLO DESDE TELÉFONO FIJO), EN BOGOTÁ (601) 6502037, EN EL HORARIO DE LUNES A VIERNES DE 8 AM A 4 PM. O POR MEDIO DE CHAT WWW.FONDODESOLIDARIDADPENSIONAL.GOV.CO/ATENCION-AL-CIUDADANO/CHAT.HTML DE 8:30 AM A 1 PM.&quot;

&quot;AL CONSULTAR LA INFORMACIÓN CON SU NÚMERO DE DOCUMENTO NO SE ENCUENTRA REGISTRADO(A) Y EN ESTADO ACTIVO PARA LA LÍNEA DE VALORACIÓN DEL CUIDADO DENTRO DEL PROGRAMA RENTA CIUDADANA. 	
NO INGRESA A RENTA CIUDADANA PORQUE EL HOGAR NO CUMPLE ALGUNA DE LAS CONDICIONES PARA SER PARTE DE VALORACIÓN DEL CUIDADO.
POR LO ANTERIOR, POR FAVOR, ESTÉ PENDIENTE DE LOS NUEVOS PROCESOS DE SELECCIÓN QUE SE ADELANTAN POR PARTE DE PROSPERIDAD SOCIAL PARA LAS DIFERENTES LÍNEAS DE INTERVENCIÓN. TENER EN CUENTA QUE NO SE REALIZARÁN PROCESOS DE CONVOCATORIAS E INSCRIPCIONES, SINO QUE PROSPERIDAD SOCIAL ADELANTA LA IDENTIFICACIÓN, SELECCIÓN Y VINCULACIÓN DE LOS HOGARES POTENCIALES BENEFICIARIOS A TRAVÉS DE REGISTROS ADMINISTRATIVOS DE LAS FUENTES OFICIALES, POR LO QUE PARA MAYOR INFORMACIÓN LE RECOMIENDO ESTAR PENDIENTE A TRAVÉS DE NUESTROS CANALES DE ATENCIÓN OFICIALES: TELEFÓNICO, VIRTUAL, PÁGINA WEB Y REDES SOCIALES.&quot;

&quot;
PROSPERIDAD SOCIAL INFORMA QUE, DEBIDO A LA ALTA CANTIDAD DE POSTULACIONES RECIBIDAS Y CON EL OBJETIVO DE REALIZAR UNA REVISIÓN MINUCIOSA Y TRANSPARENTE DEL CUMPLIMIENTO DE LOS REQUISITOS ESTABLECIDOS EN LOS TÉRMINOS DE REFERENCIA, LA PUBLICACIÓN DE LOS SELECCIONADOS NO SE LLEVÓ A CABO EL DÍA 4 DE JULIO, COMO ESTABA INICIALMENTE PREVISTO.
ACTUALMENTE, NOS ENCONTRAMOS EN LA ETAPA DE REVISIÓN DE REQUISITOS Y DOCUMENTOS, CON EL FIN DE ADELANTAR EL PROCESO DE SUBSANACIÓN. ESTA FASE PERMITIRÁ A LOS POSTULANTES COMPLETAR LA INFORMACIÓN REQUERIDA, GARANTIZANDO ASÍ UN PROCESO MÁS JUSTO, PARTICIPATIVO Y EQUITATIVO.

LA NUEVA FECHA PARA LA PUBLICACIÓN DE LOS RESULTADOS SERÁ INFORMADA OPORTUNAMENTE A TRAVÉS DE NUESTROS CANALES INSTITUCIONALES. POSTERIORMENTE, SE DARÁ INICIO AL PROCESO DE ENTREGA DE LOS ROLLOS DE TELA, EN COORDINACIÓN CON LAS GERENCIAS REGIONALES Y ALIADOS ESTRATÉGICOS, ASEGURANDO QUE LOS INSUMOS LLEGUEN A QUIENES CUMPLAN CON LA TOTALIDAD DE LOS REQUISITOS Y CUENTEN CON LA CAPACIDAD DE APROVECHARLOS EN EL FORTALECIMIENTO DE SUS ACTIVIDADES PRODUCTIVAS.

LE INVITAMOS A ESTAR PENDIENTE A NUESTROS CANALES OFICIALES DE COMUNICACIÓN, DONDE SE PUBLICARÁN LAS FECHAS Y DETALLES RELACIONADOS CON LA ENTREGA DE INSUMOS A LOS EMPRENDIMIENTOS SELECCIONADOS.&quot;

&quot;AL CONSULTAR LA INFORMACIÓN CON SU NÚMERO DE DOCUMENTO NO SE ENCUENTRA REGISTRADO(A) Y EN ESTADO ACTIVO PARA LA LÍNEA DE VALORACIÓN DEL CUIDADO DENTRO DEL PROGRAMA RENTA CIUDADANA. NO INGRESA A RENTA CIUDADANA PORQUE SU HOGAR NO HACE PARTE DEL GRUPO A DE SISBÉN IV.
POR LO ANTERIOR, POR FAVOR, ESTÉ PENDIENTE DE LOS NUEVOS PROCESOS DE SELECCIÓN QUE SE ADELANTAN POR PARTE DE PROSPERIDAD SOCIAL PARA LAS DIFERENTES LÍNEAS DE INTERVENCIÓN. TENER EN CUENTA QUE NO SE REALIZARÁN PROCESOS DE CONVOCATORIAS E INSCRIPCIONES, SINO QUE PROSPERIDAD SOCIAL ADELANTA LA IDENTIFICACIÓN, SELECCIÓN Y VINCULACIÓN DE LOS HOGARES POTENCIALES BENEFICIARIOS A TRAVÉS DE REGISTROS ADMINISTRATIVOS DE LAS FUENTES OFICIALES, POR LO QUE PARA MAYOR INFORMACIÓN LE RECOMIENDO ESTAR PENDIENTE A TRAVÉS DE NUESTROS CANALES DE ATENCIÓN OFICIALES: TELEFÓNICO, VIRTUAL, PÁGINA WEB Y REDES SOCIALES.&quot;

CORDIALMENTE, LE INFORMAMOS QUE LA SEGUNDA FOCALIZACIÓN O SELECCIÓN DE HOGARES PARA EL PROGRAMA RENTA CIUDADANA, SE REALIZARÁ EN EL TRANSCURSO DEL MES DE AGOSTO 2025, POR LO CUAL LE INVITAMOS A ESTAR PENDIENTE A NUESTROS CANALES DE ATENCIÓN A FINALES DEL MES DE AGOSTO E INICIOS DEL DE SEPTIEMBRE. EN DICHO MOMENTO LE COMPARTIREMOS LA INFORMACIÓN QUE YA TENGAMOS DISPONIBLE.

&quot;LE INFORMAMOS QUE EL PROCESO DE BANCARIZACIÓN CON EL BANCO AGRARIO DE COLOMBIA ES DE CARÁCTER CONTINUO Y ESTA ENTIDAD ES LA ÚNICA RESPONSABLE DE VALIDAR Y ACEPTAR EL REGISTRO PARA PODER REALIZAR LA ENTREGA DE LOS RECURSOS CORRESPONDIENTES A LAS TRANSFERENCIAS BAJO LAS CONDICIONES ESTABLECIDAS POR EL BANCO, LAS CUALES LE SERÁN EXPLICADAS DURANTE LA COMUNICACIÓN DIRECTA CON ELLOS.

TENGA EN CUENTA QUE ESTE PROCESO NO ES INMEDIATO DENTRO DEL PROGRAMA Y CUALQUIER CAMBIO EN LA MODALIDAD DE PAGO APLICARÁ ÚNICAMENTE PARA EL SIGUIENTE CICLO DE TRANSFERENCIAS, SIEMPRE Y CUANDO SU HOGAR CONTINÚE SIENDO BENEFICIARIO. POR ELLO, LE INVITAMOS A COMUNICARSE EN LOS PRÓXIMOS CICLOS Y VERIFICAR SI SU BANCARIZACIÓN HA SIDO AUTORIZADA PARA RECIBIR EL PAGO.&quot;
POR EL MOMENTO NO ES POSIBLE CONFIRMAR ESA INFORMACIÓN YA QUE SOLO SE SABE CUANDO ESTAMOS EN PAGOS. POR EL MOMENTO, NO CONTAMOS CON FECHAS EXACTAS PARA LA PRÓXIMA ENTREGA. LE AGRADECEMOS ESTAR PENDIENTE A TRAVÉS DE NUESTROS CANALES DE ATENCIÓN OFICIALES: TELEFÓNICO, VIRTUALES, PÁGINA WEB Y REDES SOCIALES. GRACIAS POR SU COMPRENSIÓN.

SI TIENE ALGUNA PREGUNTA O REQUIERE ASISTENCIA ADICIONAL SOBRE ESTE PROCESO, COMUNÍQUESE CON EL BANCO AGRARIO DE COLOMBIA, LÍNEAS TELEFÓNICAS: EN BOGOTÁ (601) 7948567 / EN EL RESTO DEL PAÍS: 01 8000 955500, 24 HORAS Y 7 DÍAS DE LA SEMANA, CHAT PRODUCTO FINANCIERO: CHAT:
HTTP://WWW.BANCOAGRARIO.GOV.CO/CONTACTENOS
